import React from 'react';
import UserInfo from './leftside/userInfo'
import ShowTweets from '/rightside/showTweets'

class TwoBoxes extends React.Component {

    constructor() {
        super();
    }

    render(props) {
        return (
            <div className="TwoBoxes">
                <div className="leftSide">
                    {props.left}
                </div>
                <div className="rightSide">
                    {props.right}
                </div>
            </div>
        );
    }
}

export default Box;
